import React from "react";
import { Link } from "react-router-dom";
import "./dash.css";

function Sidebar() {
  return (
    <div className="sidebar">
      <h2>Future Coders
      </h2>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/students">students</Link></li>
        <li><Link to="/teachers">Teacher</Link></li>
      </ul>
    </div>
  );
}

export default Sidebar;
